import React from "react";
import { Modal } from "react-bootstrap";

const ModalInfo = (props) => {
  return (
    <>
      <Modal
        {...props}
        size="xl"
        aria-labelledby="contained-modal-title-vcenter"
        centered
      ></Modal>
    </>
  );
};

export default ModalInfo;
